INSERT INTO `berita` (`id_berita`, `id_user`, `slug_berita`, `judul_berita`, `isi`, `status_berita`, `jenis_berita`, `keywords`, `gambar`, `icon`, `hits`, `urutan`, `tanggal_post`, `tanggal_publish`, `tanggal`) VALUES
(1, 3, 'wisata-perak-kotagede', 'Wisata Perak Kotagede', '<p data-adtags-visited=\"true\">Apakah Anda menyukai perhiasan? Bagaimana dengan perhiasan atau aksesoris yang terbuat dari perak? Di Yogyakarta sendiri, tempat terbaik untuk mendapatkan perak adalah di Kotagede.</p>\r\n<p data-adtags-visited=\"true\">Gapura besar menyambut setiap pengendara yang melewati pertigaan Gedong Kuning menuju Jalan Kemasan, Kotagede.&nbsp;<em>Selamat datang di Sentra Kerajinan Perak Kotagede</em>, begitu bunyi tulisan yang tertera di atasnya. Di hari-hari kerja biasa, jalanan ini memang tidak begitu ramai, namun jika sudah tiba akhir minggu atau masa liburan, biasanya mulai terlihat para pemburu perak yang bertandang ke toko-toko yang berjejer di sepanjang jalan.</p>\r\n<p data-adtags-visited=\"true\">Memang ada banyak sekali toko yang menjual kerajinan dan perhiasan perak di sepanjang Jalan Kemasan. Baik toko kecil maupun besar menjual beragam hasil kerajinan seperti kalung, cincin, gelang atau souvenir dengan bentuk-bentuk unik dan rumit. Wahyu (24), salah satu pembeli aksesoris perak mengaku Kotagede adalah tujuan utama jika ingin mencari aksesoris atau cinderamata dari perak.</p>\r\n<p data-adtags-visited=\"true\">&ldquo;Perak itu emang bagus ya buat aksesoris dan harganya juga lebih terjangkau dari emas..&rdquo;, ujar Wahyu, saat ditanyai mengapa ia memilih perak.</p>\r\n<p data-adtags-visited=\"true\">Toko-toko di sepanjang Jalan Kemasan biasanya hanya menjual kerajinan perak saja, sementara produksinya sendiri dilakukan di rumah para pengrajin yang berlokasi di Kampung Basen. Merasa penasaran dengan proses produksi kerajinan perak ini, Atmanews lantas bertandang ke Kampung Basen, yang letaknya tak jauh dari jalan utama Kotagede. Kampung Basen sendiri merupakan kampung yang sudah diresmikan sebagai kampung wisata kerajinan perak sejak 23 Agustus 2011. Kampung ini berhasil menjadi kampung wisata setelah menjalankan program pengembangan wirausaha penduduk dalam bidang kesenian dan kuliner.</p>\r\n<p data-adtags-visited=\"true\">Pengembangan ini sejalan dengan upaya pemerintah yang ingin mengangkat kerajinan perak Kotagede sebagai daya tarik wisatawan. Kampung Basen bahkan juga telah memiliki&nbsp;<em>website</em>&nbsp;mereka sendiri sebagai alat bantu promosi dan pengenalan pariwisata kepada khalayak luas</p>\r\n<p data-adtags-visited=\"true\">Sebagian besar penduduk masyarakat Basen mencari nafkah sebagai pengrajin logam, terutama perak, emas dan tembaga. Mereka juga memiliki asosiasi pengrajin sendiri, yakni Asosiasi Senopati. Salah satu pengrajin perak tersebut adalah Pak Tumijo yang sudah lebih dari 20 tahun menggeluti pekerjaannya. Pak Tumijo tinggal di rumah sederhana yang juga merupakan bengkel kerja dan&nbsp;<em>showroom</em>&nbsp;produksi peraknya sendiri.</p>\r\n<p data-adtags-visited=\"true\">Pak Tumijo mengklaim, hasil kerajinan perak buatannya beda dari yang lain, karena lebih rumit desain dan detailnya. Memang betul, kerajinan perak milik Pak Tumijo menonjolkan lebih banyak detail, seperti penggunaan ornamen lengkung dan spiral.</p>\r\n<p data-adtags-visited=\"true\">&ldquo;Di kampung Basen, memang jarang yang bikin seperti ini, biasanya hanya yang polos-polos saja, karena itu lumayan banyak juga yang pesan kesini..&rdquo;, ungkap Pak Tumijo dengan senyuman.</p>\r\n<p id=\"inline-ad-0\" class=\"inline-ad-slot\" data-adtags-width=\"661\" data-adtags-visited=\"true\">&nbsp;</p>\r\n<p data-adtags-visited=\"true\">Selain melihat-lihat cinderamata buatan Pak Tumijo, beliau juga mengizinkan Atmanews untuk melihat secara langsung proses produksi kerajinan ini. Sayangnya, karena Pak Tumijo masih dalam tahap awal pengerjaan, ia tidak bisa memperlihatkan tahap pembuatannya hingga akhir. Saat itu, Pak Tumijo sedang mengerjakan pesanan bros dalam jumlah besar yang akan diekspor ke China.</p>\r\n<p>Bahan utama pembuatannya adalah kawat tipis perak yang bisa dibentuk menjadi apa saja melalui berbagai teknik. Untuk membuat detail ornamen, Pak Tumijo menggunakan kait besi kecil dan tang. Sementara untuk membuat butir-butiran perak, harus dilakukan pembakaran. Pak Tumijo memperlihatkan bagaimana sebuah potongan kawat perak, apabila dibakar, dengan sendirinya akan membentuk butiran.</p>\r\n<p>Setelah dibentuk sesuai keinginan, perak-perak tersebut dibasahi dan ditaburi bubuk patri, dibakar, dan kemudian direbus dengan air tawas. Perebusan dan pembakaran ini disebut sebagai pemutihan, dan dilakukan sebanyak 3 hingga 4 kali. Hasilnya adalah perak dengan warna yang bersih dan berkilau.</p>', 'Publish', 'Berita', 'Integrasi Data dan Pengetahuan', 'img_0999.jpg', '', 14, 0, '2019-05-13 15:51:51', '2021-05-05 15:51:36', '2021-08-21 07:53:46'),
(2, 3, 'kampung-gedongan', 'Kampung Gedongan', '<p>Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt. Neque porro quisquam est, qui dolorem ipsum quia dolor sit amet, consectetur, adipisci velit, sed quia non numquam eius modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem. Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquid ex ea commodi consequatur? Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil molestiae consequatur, vel illum qui dolorem eum fugiat quo voluptas nulla pariatur?\"</p>', 'Publish', 'Kampung', 'Kampung yang memiliki ada Upacara Adat ( Nyadran)', 'gdd_1.png', 'fa fa-globe', 79, 3, '2019-05-17 04:15:33', '2021-07-02 04:06:15', '2021-08-19 11:23:55'),
(3, 3, 'kampung-purbayan', 'Kampung Purbayan', '<p style=\"text-align: justify;\">Kampung wisata Purbayan secara kewilayahan berada di Kelurahan Purbayan, Kecamatan Kota Gede dan berada di Kawasan Cagar Budaya Kota Gede, Kota Yogyakarta, Daerah Istimewa Yogyakarta.</p>\r\n<p style=\"text-align: justify;\">Kota Gede adalah sebuah daerah yang dahulu merupakan cikal bakal Kerajaan Mataram Islam pertama. Lokasi tersebut saat ini merupakan kawasan wisata budaya berbasis heritage. Melalui Kampung Wisata Purbayan inilah Anda bisa mengetahui awal mula sejarah Kasultanan Ngayogyakarta Hadiningrat.</p>', 'Publish', 'Kampung', 'Kampung Wisata Berbasis Religius', 'lw.jpg', 'fa fa-globe', 11, 4, '2019-05-17 04:37:00', '2021-07-01 04:36:19', '2021-08-21 16:12:34'),
(6, 3, 'kampung-basen', 'Kampung Basen', '<p style=\"text-align: justify;\">Kampung Basen adalah sebuah tempat wisata yang ada di wilayah Kota Gede, Yogyakarta lebih tepatnya di Jalan Kemasan, Purbayan, Kotagede, Yogyakarta. Awal berdirinya kampung basen adalah adanya tokoh dari kerajaan mataram yang konon katanya pendiri agama islam yaitu Kyai Basah beliau dulunya tinggal di kampung tersebut dan mendirikan padepokan, jadi kampung ini disebut Basen. Lalu di pojok kampung ada &ldquo;Mbaluarti&rdquo; yaitu tempat istirahatnya wanita-wanita atau kerabat wanita dari keraton, biasanya untuk tempat bermain. Bentuknya bukan kerajaan tapi padepokan. Kondisi sosial budaya di Kampung Basen itu sangat unik, warga di Kampung Basen sangat ramah dan terbuka, mereka mau menerima pendatang baru. Ketika mendatangi Kampung Basen pasti anda akan kaget karena akan di hadapkan oleh kelompok assosiasi para pengrajin, seperti assosiasi sayur lodeh, assosiasi penjahit, assosiasi lotek, dan lainnya. Assosiasi adalah badan organisasi yang khusus diadakan oleh manusia untuk mencapai tingkat hidup yang lebih baik (dalam memenuhi kebutuhan ekonomi), orang membentuk assosiasi seperti firma, perseroan terbatas, serikat buruh dan sebagainya. Organisasi yang ada di kampung Basen yaitu PKK, posyandu untuk balita dan lansia, BKKBN (BKB itu Bina Keluarga Balita, BKR itu Bina Keluarga Remaja, dan BKL yaitu Bina Keluarga Lansia). Organisasi ini dilaksanakan dengan baik oleh warga yang ada di Kampung Basen. Selain itu ada kegiatan yang sering dilakukan oleh warga Kampung Basen seperti di RT 10 ibu-ibu biasanya melakukan kerja bakti di minggu terakhir, ada arisan di tingkat RT dan RW, dan Aisyah Muhammadyah yang&nbsp;&nbsp;kegiatannya macam-macam yaitu ada pertemuan rutin, pengajian, kegiatan santunan anak asuh, ada pemeriksaan kesehatan lansia secara gratis, ada kegiatan ekonomi. Perekonomian Kampung Basen sekarang sedang &ldquo;lesu&rdquo; atau sedang sepi. Alasannya karena teknologi sudah maju orang-orang sekarang kalau pesan tidak langsung datang ke rumah, tapi memakai online. Padahal yang memakai sistem online seperti itu belum tentu punya toko. Dulu sebelum adanya teknologi yang canggih masih ada pengunjung mancanegara ataupun domestik yang datang ke rumah untuk melihat proses pembuatan secara langsung kemudian mereka memesan, soalnya yang mancanegara itu biasanya lebih suka yang <em>handsmade&nbsp;</em>(buatan tangan/ bukan mesin) yang di hasilkan oleh&nbsp;<em>handsmade&nbsp;</em>ini banyak yang di pesan untuk sorum atau toko-toko di depan itu. Tetapi toko-toko yang berdiri di depan 50 % sudah bukan dari warga sini kebanyakan pendatang baru dari luar wilayah ini. Yang asli dari wilayah ini malah justru menjadi pekerja nya bukan pemilik toko, toko-toko tersebut belum tentu tau proses kerja dari pembuatan cincin dan lainnya. Sistem sosial di Kampung Basen yang pertama adalah norma dan peraturan, norma menurut Emil Durkheimbahwa norma-norma sosial adalah sesuatu yang berada di luar individu. Membatasi mereka dan mengendalikan tingkah laku mereka. Membicarakan tentang norma dan peraturan di Kampung Basen memiliki norma dan aturan yang cukup mengesankan yaitu contohnya jam belajar masyarakat, kemudian menjadi kawasan bebas rokok untuk seluruh kampung ini, di tunjuk sebagai <em>pilot project.</em>&nbsp;Aturan yang dibuat oleh warga ini dilaksanakan dengan baik, meskipun masih banyak juga yang melanggarnya.&nbsp;Yang kedua adalah masalah sosial yang ada di masyarakat Kampung Basen seperti balita kemarin kurang gizi, kemudian merokok masih remaja, kenakalan remaja. Masalahnya adalah seperti kenakalan remaja, lalu remaja yang merokok, kemudian karena di sini ada banyak kontrakan atau kos-kosan jadi rawan sekali adanya&nbsp;&nbsp;fitnah, pernah terjadi salah satu warga kepergok satu kontrakan tapi tidak menikah, akhirnya masalah di selesaikan ke tingkat RT, jika tidak bisa di selesaikan lewat RT naik banding ke RW.&nbsp;Ini membuktikan bahwa lembaga sosial yang ada di Kampung Basen menjalankan tugas nya dengan baik, kedudukan dan status sosial yang ada di Kampung Basenmembuktikan bahwaperan lembaga RW dan RT dalam menyelesaikan masalah dan menjalankan tugas nya sangat bertanggung jawab.&nbsp;Tradisi yang selalu di lakukan oleh warga Kampung Basen adalah setiap ada &ldquo;Gelar Budaya Kota Gede&rdquo;. Acarannya yaitu di setiap kampung mengirimkan salah satu perwakilan budaya nya, kalau di kampung Basen itu mereka merias warga persis penampilannya dengan Kyai Basah, dan nanti ada karnaval atau pawai acaranya itu Juni atau Juli, nah nanti dari Gedongan kampung sebelah juga ada, tetapi tradisi ini untuk lingkup Kota Gede, kalau lingkup kampung tidak ada. Hanya tradisi setiap tahun saja secara nasional memperingati HUT RI ada banyak lomba di sini.&nbsp;Ada banyak komunitas yang terbentuk di Kampung Basen, contohnya ada komunitas karawitan bapak-bapak, ada juga bapak-bapak muda, kalau hari rabu ada karawitan untuk anak-anak tempatnya di balai RW. Ini adalah upaya untuk mempertahankan tradisi dan budaya di kampung tersebut. kemudian kedepannya ketika ada pernikahan mereka berencana tidak pakai kaset tetapi tampil&nbsp;<em>live</em>&nbsp;atau secara langsung. Di kampung itu juga ada komunitas keroncong, kalau dari wanita ada karawitan juga kebetulan paud di Kampung Basen sudah cukup ternama karena mengikuti gebyar paud tingkat provinsi, tingkat kota. Biasanya mereka menampilkan anak-anak dengan iringan&nbsp;<em>live&nbsp;</em>yang di iringi oleh bapa/ibu nya melalui karawitan. Januari nanti ada gebyar paud dan anak-anak akan di keluarkan lagi untuk tampil.&nbsp;Di yogyakarta yang terbesar kampungnya adalah Kampung Basen, karena setiap kampung itu maksimal 4 RT, tetapi di Kampung Basen itu ada 7 RT, karena jika di buat dua RW, warganya yang tidak mau nanti tidak adil. Karena khawatir ada kecemburuan sosial antar warganya, kegiatan di kampung itu padat sekali contoh kalau hari selasa anak-anak paud, hari sabtu itu juga paud, hari jumat sore itu ibu-ibu belajar iqra lansia, karena untuk bekal ketika ingin naik haji mereka sudah punya bekal, kemudian malam selasa itu ada kegiatan untuk ibu-ibu muda membaca iqra dengan juz&rsquo;ama, malam kamisnya itu yang sudah hafal Al-Qur&rsquo;an, jadi memang ada tingkatan kalau yang hari selasa sudah bisa baca Qur&rsquo;an mereka bisa langsung datang hari kamis.&nbsp;Kemudian bapa-bapa, malam sabtu karawitan, kemudian bulan Desember kampung Basen di tunjuk sebagai kampung tangguh bencana, karena mereka sudah selesai pelatihan maka namanya tangguh bencana, kalau yang belum selesai pelatihan itu namanya tanggap bencana. Mereka sudah mendirikan KTB, kemudian mendapat bantuan berupa alat dari BPPD kota ketika ada gempa bumi, karena kampung ini terlewati garis merah bencana gempa bumi, ketika terjadi gempa bumi tahun 2006 kampung ini rusak parah.&nbsp;Program di kampung ini sudah tersusun rapi, seperti adanya sumbangan kematian itu panitia dari bapak-bapak langsung bergerak ke rumah warga, kemudian ketika ada pernikahan mereka langsung bergerak untuk membertahu warga, namun ada yang unik di Kampung Basen sistemnya bukan memakai undangan tetapi langsung mendatangi ke rumah-rumah warga dengan menggunakan bahasa jawa halus, tradisi kejawen di sini masih di terapkan, kemudian kampung basen memiliki aturan yang cukup ketat, di kampung ini tidak boleh ada yang nikah sirih hidup serumah di tanah Basen, dan setiap ada keluarga yang dari luar kota ingin tinggal di Kampung Basen mereka harus membayar uang kompensasi yang akan masuk uang kas RW.</p>', 'Publish', 'Kampung', 'Kampung Basen adalah sebuah tempat wisata yang ada di wilayah Kota Gede', 'desa_basen.jpeg', 'fa fa-globe', 19, 2, '2021-08-05 13:14:08', '2021-08-05 13:08:14', '2021-08-27 13:27:14'),
(13, 29, 'kampung-alun-alunnn', 'Kampung Alun-Alunnn', '<p>Terletak di salah satu dari lima kawasan cagar budaya Yogyakarta, Kampung Alun-alun menyuguhkan bangunan tua dengan nilai historis tinggi yang memanjakan mata. Untuk menuju lokasi Kampung Alun-alun cukup mudah meski daerah Kotagede ratarata kondisi jalannya tak cukup lebar. Dari Masjid Kotagede, berjalan ke arah selatan sekitar 100 meter. Nanti akan menjumpai gapura bercat putih dengan ornamen tanduk kerbau, di sisi timur jalan. Itulah gerbang masuk menuju Kampung Alun-alun, perkampungan yang sejak berdiri memang diapit oleh dua gapura di ujung barat dan timur. &ldquo;Dinamai Kampung Alunalun karena dulu di sini berfungsi sebagai alun-alun. Dan karena berada di antara dua gerbang, gapura, maka dinamai Between Two Gates oleh tim peneliti dari UGM,&rdquo; kata Joko Nugroho, Ketua Komunitas Pethuk Lawang, sebuah komunitas konservasi budaya di kawasan cagar budaya Kotagede. Setelah memasuki Kampung Alun-alun, suasana tenang, asri, dan nyaman, ditambah pemandangan deretan bangunan tua berarsitektur Jawa kuno. Tak berhenti di situ, pengunjung lantas diajak menyusuri jalan selebar dua meter yang membelah perkampungan. Jalan itulah yang menghubungkan dua gerbang di ujung barat dan timur. Menurut penuturan warga setempat, awal mula jalan tersebut berada di atas lahan milik pribadi. Namun kearifan lokal yang masih terjaga membuat jalan bisa diakses bersama- sama, terutama oleh warga setempat dan pengunjung atau wisatawan. &ldquo;Warga di sini masih mengedepankan kearifan lokal. Warga juga memiliki kesadaran tinggi untuk menjaga dan melestarikan bangunan yang tergolong cagar budaya,&rdquo; jelas Joko. Seorang warga setempat, Mukadi menjelaskan, bangunan yang mayoritas berbentuk joglo mulai dibangun sejak tahun 1840. Hal itu terlihat dari gapura sisi timur yang tertulis tahun pembangunan pada 1840 oleh salah seorang saudagar waktu itu. Namun bencana gempa bumi melanda Bantul tahun 2006 lalu berdampak terhadap keaslian bangunan di Kampung Alun-alun. Tak sedikit bagian bangunan yang mengalami kerusakan namun kini sudah direhabilitasi dan kembali mendekati bentuk aslinya. Kini, Kampung Alun-alun telah menjadi wisata minat khusus dan memiliki ragam potensi sebagai objek wisata unggulan..</p>', 'Publish', 'Kampung', '', 'alunnn.jpg', 'fa fa-globe', 13, 1, '2021-08-19 03:57:01', '2021-08-03 03:54:21', '2021-08-26 17:54:43');
