INSERT INTO `konfigurasi` (`id_konfigurasi`, `namaweb`, `singkatan`, `tagline`, `profil`, `gambar`, `website`, `email`, `alamat`, `telepon`, `hp`, `logo`, `icon`, `facebook`, `twitter`, `instagram`, `google_plus`, `google_map`, `protocol`, `smtp_host`, `smtp_port`, `smtp_user`, `smtp_pass`, `id_user`, `tanggal`) VALUES
(1, 'KELURAHAN PURBAYAN', 'PRBYN', 'DESA WISATA PURBAYAN', '<p><strong>Kelurahan Purbayan</strong> dibentuk pada tahun 1981, berdasar Peraturan Daerah Provinsi Daerah Istimewa Yogyakarta ( Perda DIY) Nomor 6 tahun 1981 Tentang Pembentukan, Pemecahan, Penyatuan dan Penghapusan Kelurahan di Provinsi Daerah Istimewa Yogyakarta. Kelurahan Purbayan terbentuk dari 4 eks Rukun Kampung (RK) yaitu : RK Gedongan, RK Basen, RK Purbayan, dan RK Alun &ndash; Alun. Dengan pembentukan Kelurahan, 4 RK digabung dan dibagi menjadi 14 Rukun Warga (RW) dan terdiri dari 58 Rukun Tetangga (RT) dengan jumlah Kepala Keluarga 3302 KK dan jumlah penduduk 10.176 jiwa.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Batas Administrasi<br /></strong>Luas wilayah Kelurahan Purbayan sebesar 83 Ha. Luas lahan yang ada terbagi dalam beberapa peruntukan, dapat dikelompokkan seperti untuk fasilitas umum, pemukiman,&nbsp; kegiatan ekonomi dan Iain-lain.<br />Kelurahan Purbayan berada dalam wilayah Kecamatan Kotagede Kota Yogyakarta dengan nomor Kode Wilayah 34.71.14.03 dan Kode Pos 55173.<br />Kelurahan Purbayan Kecamatan Kotagede Kota Yogyakarta mempunyai luas wilayah &nbsp;&nbsp;0,83 km2 dengan peta wilayah sebagaimana ditunjukkan pada Gambar 1 dan berbatasan langsung dengan :</p>\r\n<table class=\"tiny-table\" style=\"border-collapse: collapse; width: 99.7649%; height: 88px; border-style: none;\" border=\"0\">\r\n<tbody>\r\n<tr style=\"height: 22px;\">\r\n<td style=\"width: 20.7376%; height: 22px;\">Sebelah Utara&nbsp;</td>\r\n<td style=\"width: 0.595593%; height: 22px;\">:</td>\r\n<td style=\"width: 101.744%; height: 22px;\">Desa Banguntapan &nbsp;Kecamatan Banguntapan Kabupaten Bantul</td>\r\n</tr>\r\n<tr style=\"height: 22px;\">\r\n<td style=\"width: 20.7376%; height: 22px;\">Sebelah Selatan</td>\r\n<td style=\"width: 0.595593%; height: 22px;\">:</td>\r\n<td style=\"width: 101.744%; height: 22px;\">Desa Singosaren Kecamatan Banguntapan Kabupaten Bantul</td>\r\n</tr>\r\n<tr style=\"height: 22px;\">\r\n<td style=\"width: 20.7376%; height: 22px;\">Sebelah Barat&nbsp;</td>\r\n<td style=\"width: 0.595593%; height: 22px;\">:</td>\r\n<td style=\"width: 101.744%; height: 22px;\">Desa Jagalan Kecamatan Banguntapan Kabupaten Bantul dan Kelurahan Prenggan, Kelurahan Rejowinangun Kota Yogyakarta</td>\r\n</tr>\r\n<tr style=\"height: 22px;\">\r\n<td style=\"width: 20.7376%; height: 22px;\">Sebelah Timur</td>\r\n<td style=\"width: 0.595593%; height: 22px;\">:</td>\r\n<td style=\"width: 101.744%; height: 22px;\">Desa Banguntapan Kecamatan Banguntapan Kabupaten Bantul</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>Kondisi dan Ciri Geografis Wilayah<br /></strong>Ketinggian Wilayah Kelurahan Purbayan secara umum terletak pada posisi 113 m di atas permukaan laut. Kelurahan Purbayan terletak di wilayah Kecamatan Kotagede Kota Yogyakarta yang merupakan kota tua bekas Ibu kota kerajaan, Kota Kotagede merupakan kota warisan (<em>heritage</em>) yang amat berpotensi bagi kemakmuran masyarakatnya dan merupakan daerah hunian padat. Walaupun di Kelurahan Purbayan relatif tidak ada industri besar, namun kegiatan ekonomi bergerak cukup tinggi terutama karena digerakkan oleh kerajinan industri perak (<em>silver</em>) yang berada di dan sekitar Kelurahan Purbayan. Jarak Purbayan dari pusat Pemerintahan Kecamatan 500 M, Pemerintahan Kota 4&nbsp; Km.</p>', NULL, 'https://desawisatapurbayan.com', 'purbayanvillage2021@gmail.com', 'Jalan Kemasan No. 39 A, Kotagede, Yogyakarta', '(0274) 417010', '+6281393265996', 'pr_logo.png', 'pr_logo1.png', 'https://www.facebook.com/', 'http://twitter.com/', 'https://instagram.com/', 'https://www.youtube.com/channel/UCmm6mFZXYQ3ZylUMa0Tmc2Q', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d7905.308812963822!2d110.3966116265691!3d-7.826353848521722!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e7a57181514fb01%3A0xe72c51062c9d3bfa!2sPurbayan%2C%20Kec.%20Kotagede%2C%20Kota%20Yogyakarta%2C%20Daerah%20Istimewa%20Yogyakarta!5e0!3m2!1sid!2sid!4v1629272883043!5m2!1sid!2sid\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\"></iframe>', 'smtp', 'ssl://smtp.googlemail.com', 465, 'wahyu.oktavian231@gmail.com', 'doomov23', NULL, '2021-08-25 06:04:06');
